import React,{useState} from 'react'
import { useNavigate,Link } from 'react-router-dom'
const Register = () => {
  let navigate = useNavigate();
  const [credentials, setCredentials] = useState({"fname":"dnone", "lname":"dnone","email":"","password":""})
  const [placeholder, setPlaceholder] = useState({"name":"dnone","uname":"dnone", "pwd":"dnone"})
  const [height,setHeight] = useState({"fname":"ihide", "lname":"ihide","uname":"ihide", "pwd":"ihide"})

  const onChangelogin = (e) => {
      setCredentials({...credentials,[e.target.name]:e.target.value})
  } 

  const handleSubmit = async (e) => {
    e.preventDefault();
    const response = await fetch ("http://localhost:4000/api/v1/auth",{
      method:'POST',
      headers: {
        'Content-Type': 'application/json'
      },
      body: JSON.stringify({name: credentials.name, email: credentials.email, password: credentials.password})
    })
    const json = await response.json()
    if (json.success){
      // Save the auth token and redirect
      localStorage.setItem('token', json.authtoken); 
      navigate('/');
    }
    else{
      alert('try again')
    }
  }


  return (
    <div className='lr-con'>
    <form className='lr-form' onSubmit={handleSubmit}>
        <h1 className='lr-f-title'>Register</h1>
        <div className='radio-heading'>Title</div>
            <div className='select-radio-con'>
                <div class="form-check select-radio">
                    <input class="form-check-input select-input" type="radio" name="titleOptions" id="titleOptions1"/>
                    <label class="form-check-label select-label" for="titleOptions1">
                        Mr
                    </label>
                </div>
                <div class="form-check select-radio">
                    <input class="form-check-input select-input" type="radio" name="titleOptions" id="titleOptions2" />
                    <label class="form-check-label select-label" for="titleOptions2">
                        Mrs
                    </label>
                </div>
            </div>
        <div className='d-flex'>
                <div className='lr-input-item'>
                    <div className={`lr-placeholder ${placeholder.fname}`}>First name</div>
                    <input className={`fname-input mutli-input lr-input ${height.fname}`} onFocus={(e)=> {
                            if(!e.target.value){
                                e.target.placeholder="" 
                                setPlaceholder({...placeholder,"fname":"dblock"})
                                setHeight({...height,"fname":"ishow"})
                            }
                        }
                    } 
                    onBlur={(e)=> {
                            if(e.target.value === ''){
                                e.target.placeholder="First name"
                                setPlaceholder({...placeholder,"fname":"dnone"})
                                setHeight({...height,"fname":"ihide"})
                            }
                        }
                    } 
                    placeholder='First name' onChange={onChangelogin}  value={credentials.firstname} type="text"  name="firstname" id="firstname"/>
                </div>
                <div className='lr-input-item'>
                    <div className={`lr-placeholder ${placeholder.lname}`}>Last name</div>
                    <input className={`lname-input mutli-input lr-input ${height.lname}`} onFocus={(e)=> {
                            if(!e.target.value){
                                e.target.placeholder="" 
                                setPlaceholder({...placeholder,"lname":"dblock"})
                                setHeight({...height,"lname":"ishow"})
                            }
                        }
                    } 
                    onBlur={(e)=> {
                            if(e.target.value === ''){
                                e.target.placeholder="Last name"
                                setPlaceholder({...placeholder,"lname":"dnone"})
                                setHeight({...height,"lname":"ihide"})
                            }
                        }
                    } 
                    placeholder='Last name' onChange={onChangelogin}  value={credentials.lastname} type="text"  name="lastname" id="lastname"/>
                </div>
            </div>
        <div className='lr-input-item'>
            <div className={`lr-placeholder ${placeholder.dob}`}>Date of birth</div>
            <input className={`dob-input lr-input ${height.dob}`} 
            placeholder='Date of birth' onChange={onChangelogin}  value={credentials.dateofbirth} type="date"  name="dateofbirth" id="dateofbirth"/>
         </div>
         <div className='select-radio-con'>
                <div class="form-check select-radio">
                    <input class="form-check-input select-input" type="radio" name="genderOptions" id="genderOptions1"/>
                    <label class="form-check-label select-label" for="genderOptions1">
                        Male
                    </label>
                </div>
                <div class="form-check select-radio">
                    <input class="form-check-input select-input" type="radio" name="genderOptions" id="genderOptions2" checked/>
                    <label class="form-check-label select-label" for="genderOptions2">
                        Female
                    </label>
                </div>
            </div>
        <div className='lr-input-item'>
            <div className={`lr-placeholder ${placeholder.uname}`}>Email</div>
            <input className={`uname-input lr-input ${height.uname}`} onFocus={(e)=> {
                    if(!e.target.value){
                        e.target.placeholder="" 
                        setPlaceholder({...placeholder,"uname":"dblock"})
                        setHeight({...height,"uname":"ishow"})
                    }
                }
            } 
            onBlur={(e)=> {
                    if(e.target.value === ''){
                        e.target.placeholder="Enter your email address"
                        setPlaceholder({...placeholder,"uname":"dnone"})
                        setHeight({...height,"uname":"ihide"})
                    }
                }
            } 
            placeholder='Enter your email address' onChange={onChangelogin}  value={credentials.email} type="text"  name="email" id="username"/>
        </div>
        <div className='lr-input-item'>
            <div className={`lr-placeholder ${placeholder.pwd}`}>Password</div>
            <input className={`pwd-input lr-input ${height.pwd}`} onFocus={(e)=> {
                    if(!e.target.value){
                        e.target.placeholder="" 
                        setPlaceholder({...placeholder,"pwd":"dblock"})
                        setHeight({...height,"pwd":"ishow"})
                    }
                }
            } 
            onBlur={(e)=> {
                    if(e.target.value === ''){
                        e.target.placeholder="Enter your password"
                        setPlaceholder({...placeholder,"pwd":"dnone"})
                        setHeight({...height,"pwd":"ihide"})
                    }
                }
            }   
            placeholder='Enter your password'  onChange={onChangelogin}  value={credentials.password} type="text"  name="password"id="password"/>
        </div>
        <div className='d-flex'>
            <div class="dropdown">
                <div class="btn btn-secondary dropdown-toggle" href="#" role="button" data-bs-toggle="dropdown" aria-expanded="false">
                    Dropdown link
                </div>
                <div class="dropdown-menu">
                    <li><a class="dropdown-item" href="#">Action</a></li>
                    <li><a class="dropdown-item" href="#">Another action</a></li>
                    <li><a class="dropdown-item" href="#">Something else here</a></li>
                </div>
            </div>
            <div className='lr-input-item'>
                <div className={`lr-placeholder ${placeholder.name}`}>Mobile Number</div>
                <input className={`uname-input lr-input ${height.name}`} onFocus={(e)=> {
                        if(!e.target.value){
                            e.target.placeholder="" 
                            setPlaceholder({...placeholder,"mobilenumber":"dblock"})
                            setHeight({...height,"mobilenumber":"ishow"})
                        }
                    }
                } 
                onBlur={(e)=> {
                        if(e.target.value === ''){
                            e.target.placeholder="Mobile Number"
                            setPlaceholder({...placeholder,"mobilenumber":"dnone"})
                            setHeight({...height,"mobilenumber":"ihide"})
                        }
                    }
                } 
                placeholder='Mobile Number' onChange={onChangelogin}  value={credentials.mobilenumber} type="text"  name="mobilenumber" id="mobilenumber"/>
            </div>
        </div>
        <button className='lr-btn'>Register</button>
    </form>
</div>
  )
}

export default Register
